import React from "react";
// import { BrowserRouter as Router, Link } from "react-router-dom";

import "./Components/animation/assets-landing/css/bootstrap.min.css";
import "./Components/animation/assets-landing/css/style.css";
// import "./Components/animation/assets-landing/css/icons.css";
import { Helmet } from "react-helmet";

function Temporary() {
  return (
    <div>
      <div id="home" className="welcome-slider-areas">
        <div
          className="single-slider"
          style={{ backgroundColor: "rgba(0,0,90,0.9)", minHeight: "100vh" }}
        >
          <div id="particles-js">
          <button>Test</button>

          </div>

          {/* <div className="slider-title">
            <div className="table-cell">

            </div>
          </div> */}
        </div>
      </div>

      <Helmet>
      <script src="js/jquery.min.js"></script>

  <script src="js/jquery.easypiechart.min.js"></script>

  <script src="js/particles.min.js"></script>

  <script src="js/app.js"></script>

  <script src="js/custom.js"></script>
   <script src="js/custom.js"></script>
      </Helmet>

    </div>
  );
}
export default Temporary;
